import React from "react";
import styled, { css }  from "styled-components";
import { useSelector } from "react-redux";
import { useState } from "react";


const Home = ()=> {
let [단어] = useState(['아니','존나','모르겠다고']);
    return (
        <div className="Home">

            <Cards>
                {
                    단어.map(function () {
                        return <CARD />
                    })
                }
            </Cards>
        </div>



    );
};

function CARD() {
    return (
        <Card>
            <h4>단어</h4>
            <h4>설명</h4>
            <h4>예시</h4>
        </Card>
    )

}



//cards
const Cards = styled.div`
    top : 10px;
    width: 100%;
    display: flex;
    flex-wrap: wrap;
    padding-top: 1px;
    justify-content: center;
`;


const Card = styled.div`
    margin: 20px;
    padding: 20px;
    width: 500px;
    min-height: 200px;
    display: grid;
    grid-template-rows: 20px 50px 1fr 50px;
    border-radius: 10px;
    box-shadow: 0px 6px 10px rgba(0, 0, 0, 0.25);
    transition: all 0.2s;

`;



export default Home;
